Borrowing gets us control over the scope and lifetime of memory allocations. But, there is a price. Recursive functions, when optimized, become an exercise in handling the borrows. That's why a fibonacci sequence in a dynamically typed language can look like this: (Lua) function fib(n) if n == 0 or n == 1 then return n else return fib(n - 1) + fib(n - 2)
end and in Rust, look like this: (Rust) fn fib(n_dyn: Rc<Any>) -> Rc<Any> { let n_static: &i32 = n_dyn.downcast_ref::<i32>().unwrap(); if *n_static == 0 { Rc::new(Box::new(*n_static)) } else { let n1 = fib(Rc::new(Box::new(n_static - 1))); let n2 = fib(Rc::new(Box::new(n_static - 2))); Rc::new( n1.downcast_ref::<i32>().unwrap() + n2.downcast_ref::<i32>().unwrap()) }
